import React from 'react';
import me from "../../assets/me.jpeg";
import aboutMe from "../../assets/aboutMe.json";

function About() {

    return(
        <div class="container">
            <div class="row">
                <div class="col">
                    <img src={me} class="img-about"/>
                </div>
                <div class="col">
                    <p>{aboutMe.text}</p>
                </div>
            </div>
        </div>
    )
}

export default About;
